import React, { Component } from "react";

import Navigation from "./Navigation";

import Content from "./Content";

import "./App.scss";



const LINKS = [
  { label: "About", to: "#" },
  { label: "How it works", to: "#" },
  { label: "Contact", to: "#" },
];

class App extends Component {
  render() {
    return (
      <div className="box">
            <Navigation links={LINKS} />
            <Content />
      </div>
    );
  }
}

export default App;
